text:
🚨🚨Sylvester Stallone calls Donald Trump  the "second George Washington" during his introduction at the America First Policy Institute Gala at Mar-a-Lago. 

“We are in the presence of a really mythical character. I love mythology.”  

“This individual does not exist on this planet. Nobody in the world could have pulled off what he pulled off. I’m in awe."  

“When George Washington defended his country, he had no idea that he was going to change the world. Because without him, you could imagine what the world would look like. Guess what? We got the second George Washington!"
@TheSlyStallone 
@realDonaldTrump 
@A1Policy 
#AmericaFirst

